import React from 'react';
import LocationList from './components/LocationList'
import './App.css';

const cities= [
  "Bangkok,th",
  "Nules,es",
  "Paris,fr",
  "Lima, pe",
]

function App() {
  return (
    <div className="App">
      <LocationList cities ={cities}/>

    </div>
  );
}

export default App;
